import React from 'react'
import { Icon } from 'antd'
import Link from 'next/link'
import styled from 'styled-components'
import LogoSvg from 'static/images/logo_footer.svg'
import Container from './Container'

const FooterWrapper = styled.footer`
  background: #262e3d;
  position: relative;
`
const FooterFlex = styled.div`
  display: flex;
  line-height: 100px;
`
const FooterFlexLeft = styled.div`
  flex: 1;
  text-align: left;
  a {
    font-size: 26px;
    color: #fff;
  }
`
const FooterFlexRight = styled.div`
  flex: 1;
  text-align: right;
  a {
    font-size: 26px;
    color: #fff;
  }
`
const FooterLogo = styled.div`
  a {
    display: inline-block;
    svg {
      position: relative;
      font-size: 26px;
      right: 2px;
      top: 4px;
    }
    span {
      margin-left: 2px;
      color: #ffffff;
      font-weight: bold;
      font-size: 22px;
      letter-spacing: 1px;
      position: relative;
      bottom: 1px;
    }
  }
`

const Footer = () => {
  return (
    <FooterWrapper>
      <Container>
        <FooterFlex>
          <FooterFlexLeft>
            <FooterLogo>
              <Link href="/">
                <a title="Logo">
                  <LogoSvg />
                  <span>LINENAJA</span>
                </a>
              </Link>
            </FooterLogo>
          </FooterFlexLeft>
          <FooterFlexRight>
            <a href="#">
              <Icon type="facebook" theme="outlined" />
            </a>
          </FooterFlexRight>
        </FooterFlex>
      </Container>
    </FooterWrapper>
  )
}

export default Footer
